import React from 'react';
import 'react-native-gesture-handler';
import {NavigationContainer} from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/drawer';
import {StatusBar} from 'react-native';
import Index from './src/Componentes/Index';
import Form from './src/Componentes/Form';
import Dicas from './src/Componentes/Dicas';


const Tab = createBottomTabNavigator();

export default function App() {
  return ( 
     <NavigationContainer>
      <StatusBar/>

        <Tab.Navigator initialRouteName="Index" screenOptions={({route}) => ({
          tabBarIcon: ({color,size}) => {
            let iconName;
            switch(route.name){
              case "Index":
                iconName = "home";
                break;
              case "Form":
                iconName = "fast-food-outline";
              break;
              case "Dicas":
                iconName = "skull-outline";
              break; 
            } 
            return<Ionicons name={iconName} size={size} color={color} />
          }
          }) } 

          tabBarOptions={{
            activeTintColor: 'red',
            inactiveTintColor: 'purple',
          }}>


          <Tab.Screen name='Home' component={Index}/>
          <Tab.Screen name='Produtos' component={Form}/>
          <Tab.Screen name='Detalhes' component={Dicas}/>

        </Tab.Navigator>


  </NavigationContainer>
  );
}
